```cpp
#include <iostream>
#include <pwd.h>
#include <unistd.h>

int main()
{
  auto uid = geteuid();
  struct passwd userinfo;
  struct passwd *result;
  char buf[8192];

  int retval = getpwuid_r(uid, &userinfo, buf, sizeof(buf), &result);

  std::cout <<  pw_name:   << userinfo.pw_name << std::endl;     // $USER
  std::cout <<  pw_passwd:   << userinfo.pw_passwd << std::endl;
  std::cout <<  pw_uid:   << userinfo.pw_uid << std::endl;
  std::cout <<  pw_gecos:   << userinfo.pw_gecos << std::endl;
  std::cout <<  pw_dir:   << userinfo.pw_dir << std::endl;       // $HOME
  std::cout <<  pw_shell:   << userinfo.pw_shell << std::endl;   // $SHELL

  char hostname[256] = {};
  if (gethostname(hostname, sizeof(hostname)) == 0) {
    std::cout <<  hostname:   << hostname << std::endl;          // $hostname
  }
}
