typedef struct
{
    uintptr_t EAX, EBX, ECX, EDX, ESI, EDI;
    uintptr_t EBP, ESP;
} Context;

extern  C  void i686_SaveContext(Context* context) {
    __asm__(
         movl %%eax, (%0)\n 
         movl %%ebx, 4(%0)\n 
         movl %%ecx, 8(%0)\n 
         movl %%edx, 12(%0)\n 
         movl %%esi, 16(%0)\n 
         movl %%edi, 20(%0)\n 
         movl %%ebp, 24(%0)\n 
         movl %%esp, 28(%0)\n 
        ::  r  (context)
    );
}
